import React, { useEffect, useState } from 'react';
import { Grid, Button, Box, FormControl, RadioGroup, FormControlLabel, FormLabel, Radio, Modal} from '@mui/material';
import '../part-timer-style.scss'
import { EmployeeTabData, employeeComplaint } from '../../../sevices/account'
import { EmployeeTag } from '../../../sevices/job';
import moment from 'moment';
import dayjs from 'dayjs';
import Loader from '../../Loader';
import CustomSnackBar from '../../../shared/snackBar';
import { isEmptyObj } from '../../../utils/genericUtilities';

function CompletedJobTab() {
    const [completedTab, setCompletedTab] = React.useState([]);
    const [meta, setMeta] = React.useState({});
    const [loading, setLoading] = useState(false);
    const [jobEmployer, setJobEmployer] = useState({});
    const [isPopupOpen, setPopupOpen] = useState(false);
    const [value, setValue] = React.useState('');
    const [openSnackbar, setOpenSnackbar] = useState(false);
    const [customMsg, setCustomMsg] = useState({});
    const handleOpenPopup = (jobId, employerId) => {
      setPopupOpen(true);
      jobId && employerId && setJobEmployer({jobId, employerId})
    };
    const handleClosePopup = () => {
        setPopupOpen(false);
      };

      const handleChange = (event) => {
        console.log("jgbhddjginj",event.target.value);
        setValue(event.target.value);
      };
    useEffect(() => {
        completedData();

    }, []);

    const handleSnackbarClick = (status, msgInfo) => {
        setOpenSnackbar(status);
        !isEmptyObj(msgInfo) && setCustomMsg(msgInfo);
      };


    const completedData = async () => {
        setLoading(true)
        let requestParams = { status: [9] };
        try {
            const response = await EmployeeTabData(requestParams);
            if (response?.status === 200) {
                console.log("jfnbjjuj",response?.data?.items);
                setCompletedTab(response?.data?.items)
                setMeta(response?.data)
            }
            setLoading(false)
        } catch (err) {
            setLoading(false)
            console.log("ERRR", err)
        }
    };
    const handleOK = async () => {
        setLoading(true)

        console.log("isnjgbgjb",jobEmployer);
        // Handle the "Yes" button click action
        const body = {}
        body.job_id = jobEmployer.jobId
        body.employer_id = jobEmployer.employerId
        body.description = value
        console.log("mfnjnuj",body);
        try {
            const response = await employeeComplaint(body); // Replace with your API call logic
            console.log("ndbyhbubu",response);
            if (response.status === 200) {
              setPopupOpen(false);
              setLoading(false)
              handleSnackbarClick(true, { type: 'success', msg: "Report Created Successfullly" })
            }
        } catch (error) {
        setLoading(false)

            // Handle any exception that occurs during the API call
            console.error('API call failed:', error);
        }
        // setIsModalVisible(false);
    };

    const EmployeeTagSubmit = async (id) => {
        setLoading(true)
        const body = { id: id, employee_tag: 9 }
        try {
            const response = await EmployeeTag(body);

            setLoading(false)
            completedData();
            // HandleViewjob()
        } catch (error) {
            setLoading(false)
        }

    }
    const buttonStyles = {
        border: '1px solid #E3ECFF',
        borderRadius: '5px',
        height: '44px',
        fontWeight: 500,
        fontSize: '16px',
        lineHeight: '20px',
        color: '#223385',
        backgroundColor: '#E3ECFF',
        textTransform: 'none',
        padding: '10px 40px',
        margin: '5px' // You can adjust the margin as needed
    };
    return (
        <div className="myJobsTabPanel AppliedJobsTab">

            <Grid container spacing={5}>

                <Grid item xs={12} sm={12} lg={8}>
                    {
                        completedTab?.length === 0 ? <div className="jobNodata">
                            <span>
                                No Data
                            </span>
                        </div> :
                            completedTab.map(ele => {

                                return (
                                    <div className="myJobsCard">
                                        <div className="cardInfoContainer">
                                            {ele?.employer_profile?.company_logo ?
                                                <img src={`${meta?.meta?.company_logo?.path}/${meta?.meta?.company_logo?.folder}/${meta?.meta?.company_logo?.sizes?.medium}/${ele?.employer_profile?.company_logo}`} className="cardLogo" /> : <img src={require("../../../assets/images/default-logo1.png")} className="cardLogo" />}
                                            <div className="cardInfoRight">
                                                <div className="cardInfoHeader">
                                                    <div className="name">
                                                        {ele?.employer_profile?.company_name}
                                                    </div>
                                                    <div className="headerRight">
                                                        <div className="jobIdInfo">
                                                            Job ID:
                                                            <span>#{ele?.job_post?.id}</span>
                                                        </div>
                                                        <div className="amount">
                                                            <span>₹ {ele?.job_post?.job_salary}</span>
                                                            <small>/{moment(ele?.job_post?.job_timing_slot, "HH:mm a").format("HH")}hr</small>
                                                        </div>
                                                    </div>
                                                </div>
                                                <div className="cardInfoBody">
                                                    <div className="cardBodyTitle">
                                                        {ele?.job_post?.title}
                                                    </div>
                                                    <div className="cardBodyContent">
                                                        {ele?.job_post?.job_description}
                                                    </div>
                                                    <div className='completedbuttonContainer'>
                                                        <div className="qualificationSetContainer">
                                                            <div className="qualificationSet">
                                                                <img src={require('../../../assets/images/work-icon.png')} alt="" />
                                                                <span>{ele?.job_post?.experience}</span>
                                                            </div>
                                                            <div className="qualificationSet">
                                                                <img src={require('../../../assets/images/location-icon1.png')} alt="" />
                                                                <span>{ele?.job_post?.city}</span>
                                                            </div>
                                                            <div className="qualificationSet">
                                                                <img src={require('../../../assets/images/graduation.png')} alt="" />
                                                                <span>{ele?.job_post?.required_qualifications}</span>
                                                            </div>
                                                        </div>
                                                        {ele?.complete_or_not && ele?.job_post?.employee_tag === 2 ?
                                                            <div className='CompletedButtonSet'>
                                                                <span style={{ marginTop: "15px", width: "100%", float: 'left' }}>Job Completed ?</span>
                                                                <Button onClick={() => EmployeeTagSubmit(ele?.job_post?.id)} style={buttonStyles} >Yes</Button>
                                                                <Button style={buttonStyles} >No</Button>
                                                            </div> : null}
                                                    </div>
                                                </div>


                                                <div className="cardInfoFooter">
                                                    <div className="cardInfoBtn">
                                                        <img src={require('../../../assets/images/date-icon1.png')} alt="" />
                                                        <span>{dayjs(ele.job_post?.working_date, "YYYY-MM-DD").format("DD-MM-YYYY")}</span>
                                                    </div>
                                                    <div className="cardInfoBtn">
                                                        <img src={require('../../../assets/images/clock-icon.png')} alt="" />
                                                        <span>{ele.job_post?.working_timing}</span>
                                                    </div>
                                                    <div style={{ cursor: "pointer" }} className="cardInfoBtn reportBtn" onClick={() => handleOpenPopup(ele?.job_post?.id, ele?.employer_profile?.id)}>
                                                        <img src={require('../../../assets/images/Report-icon.png')} alt="" />
                                                        <span>Report</span>
                                                    </div>

                                                </div>

                                            </div>
                                        </div>
                                    </div>
                                )
                            })}


                </Grid>
                <Grid item xs={12} sm={6} lg={4}>
                    <div className="registrationRightCard">
                        <div className="registrationRightImg">
                            <img src={require('../../../assets/images/registration-vector.jpg')} alt="" />
                        </div>
                        <div className="subscriptionCardCheckListContainer">
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Build your profile and so recruiters find you
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Safe and secure payment guarantee
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Get job details through your email id.
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    Find a right part time job and grow your career
                                </span>
                            </div>
                        </div>
                    </div>
                </Grid>
            </Grid>
            <Loader loading={loading} />
            {openSnackbar ? <CustomSnackBar
        openSnackbar={openSnackbar}
        snackBarMessage={customMsg?.msg}
        status={customMsg?.type}
        handleSnackbarClick={handleSnackbarClick}
      /> : null}
            {isPopupOpen ? (
                                <Modal open={isPopupOpen} onClose={handleClosePopup}>
                                  <Box
                                    sx={{
                                      position: 'absolute',
                                      top: '50%',
                                      left: '50%',
                                      transform: 'translate(-50%, -50%)',
                                      width: '80%',
                                      maxWidth: 400,
                                      bgcolor: 'background.paper',
                                      boxShadow: 24,
                                      p: 2,
                                    }}
                                  >
                                    <FormControl>
                                      <FormLabel>Report Menu</FormLabel>
                                      <RadioGroup
                                        defaultValue="female"
                                        name="controlled-radio-buttons-group"
                                        value={value}
                                        onChange={handleChange}
                                        sx={{ my: 1 }}
                                      >
                                        <FormControlLabel
                                          value="Wrong job description"
                                          control={<Radio />}
                                          label="Wrong job description"
                                        />
                                        <FormControlLabel
                                          value="Wrong treatment"
                                          control={<Radio />}
                                          label="Wrong treatment"
                                        />
                                        <FormControlLabel
                                          value="Payment issue"
                                          control={<Radio />}
                                          label="Payment issue"
                                        />
                                      </RadioGroup>
                                    </FormControl>
                                    <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                                      <Button onClick={handleClosePopup}>Close</Button>
                                      <Button
                                        // variant="contained"
                                        // color="primary"
                                        onClick={() => {
                                         // Redirect to handleChange function
                                         handleOK()
                                          // handleClosePopup(); // Close the modal
                                        }}
                                      >
                                        OK
                                      </Button>
                                    </Box>
                                  </Box>
                                </Modal>
                              ): null}
        </div>
    )
}
export default CompletedJobTab;
